function path_parse(str)//路径解析
{
    a = '';
    temp = ''//临时数据
    $n_name = "";
    $strd = "";
    $x = 0;
  for (var i = 0; i < str.length; i++) {
    
       temp+= str[i];
      if (str[i]=="/"){
          if ($x==0) {
              $strd += ' &nbsp &nbsp &nbsp &nbsp'
              $strd += '<a class="path_click" href="javascript:0" path="'+temp+'"> 全部文件  </a>' 
          }else{
              $strd +=  '<b  class="spam_b">></b>'+'<a class="path_click" href="javascript:0" path="'+temp+'"> '+$n_name+'   </a>'
          }
      $x++
         $n_name ='';
      }else{
          $n_name +=str[i]; 
      }
  };
  $(".comment_li_display").empty();
    $(".comment_li_display").append($strd)
}
