function type_switch(name,type,path){
        switch(type)
        {
        case 'dir':
          // type_switch('克隆元素,异常排除','dir',)
              now_path  =  path+'/'
              path_parse(now_path)
           // $(".comment_li_display span").html(now_path)
                   ajax = 'yes'
                    $.ajax({
                        url:"index.php?path="+now_path,
                        type:"post",
                        data:{ajax:ajax},
                        success:function(event){
                           data =  JSON.parse(event)
                           now_path = $("#now_path").val(data.path)
                           $(".comment").empty();
                           str = "";
                     
                           $.each(data.data,function(x,y){
                                str+= "<li class='comment_li'  path='"+y.path+"'   t='"+y.type+"'  name='"+y.name+"' > <input class='ched' t='"+y.type+"' type='checkbox'><a class='comment_imgs' href='javascript:0'><div style='"+'background-image:url("public/ico/'+y.type+'.png")'+"' ></div> "+y.name+"</a></li>"
                           })
                           $(".comment").append(str);
                        }
                    })
          break;
          case 'mp3':
             layer.open({
                            title: name,
                            maxmin: true,
                            type: 1,
                            content: "<center><video controls='controls'  height='500' width='780' src='"+path+"'></video></center>",
                            area: ['800px']
                        });
          break;
           case 'mp4':
            layer.open({
                            title: name,
                            maxmin: true,
                            type: 1,
                            content: "<center><video controls='controls'  height='500' width='780' src='"+path+"'></video></center>",
                            area: ['800px']
                        });
          break;
           case 'wav':
            layer.open({
                            title: name,
                            maxmin: true,
                            type: 1,
                            content: "<center><video controls='controls'  height='500' width='780' src='"+path+"'></video></center>",
                            area: ['800px']
                        });
          break;
           case 'ogg':
            layer.open({
                            title: name,
                            maxmin: true,
                            type: 1,
                            content: "<center><video controls='controls'  height='500' width='780' src='"+path+"'></video></center>",
                            area: ['800px']
                        });
          break;
          case 'img':
            layer.open({
                      title: name,
                      maxmin: true,
                      type: 1,
                      content: "<center><img width='800' src='"+path+"' alt='' /></center>",
                      area: ['800px','500px']
                });
          break;
          case 'php':
            layer.open({
                            title: name,
                            maxmin: true,
                            type: 2,
                            content: path,
                            area: ['800px','500px']
                        });
          break;
          case 'xls':

            
              url = url_sift()//地址过滤
              url+= "?fd=indexExcel_show&ur="+path;

               layer.open({
                      title: name,
                      maxmin: true,
                      type: 2,
                      content: url,
                      area: ['800px','500px']
                });
          break;


        default:
          // location.href= path;
          // window.open(path)

            layer.open({
                title: name,
                maxmin: true,
                type: 2,
                content: path,
                area: ['800px','500px']
            });
          
        
        }
}
 
 function url_sift(){ //地址过滤
    var temp = "";
    url = self.location.href;
    for (var i = 0; i < url.length; i++) {
       if ( url[i]=='?') {
        return temp;
       }else{
        temp +=url[i];
       }
    };
      return temp;
 }
