$(".float").on("mousedown",function(event){

    oDiv = document.getElementById('float');
    disX = event.clientX - oDiv.offsetLeft;
    disY = event.clientY - oDiv.offsetTop;
    $("#float").css("display","block");
      document.onmousemove = function(ev){
     cols = ['#f5d76e', '#f7ca18', '#f4d03f', '#ececec', '#ecf0f1', '#a2ded0'];
     rand =  Math.random(0)*6;

          if (oDiv.offsetLeft<0||oDiv.offsetTop<0) {
       
          }  x = ev.pageX  - disX
            y =ev.pageY - disY
          $("#float").css('box-shadow','0 0 8px '+cols[rand])
              $(".float").css({
                'left': x+ 'px',
                'top': y +'px'
           })
      }
       document.onmouseup = function () {
            document.onmousemove = null;
            document.onmouseup = null;

        }
})
